const room = {
    id: 1,
    roomId: 1,
    img: 'img',
    userId: 1,
    roomType: 'type',
    start: '1-1-2000',
    end: '1-1-2000'
}
const user = {
    id: room.id,
    img: room.img,
    roomType: room.roomType
}
const admin = {
    id: room.id,
    roomId: room.roomId,
    userId: room.userId,
    start: room.start,
    end: room.end
}

const userList = [];
for(let i = 0; i < 32; i++) userList.push(JSON.parse(JSON.stringify(user)));

const adminList = [];
for(let i = 0; i < 16; i++) adminList.push(JSON.parse(JSON.stringify(admin)));
export default{
    userList, adminList
}
